import axios from 'axios'
export const handleMaster = (data) => {
    console.log(data)
    axios.post(`https://172.105.49.15:3030/api/user/add_user`, {
        name:data.name,
        mobile_number:data.mobile,
        email_id:data.login_email,
        status:data.status,
        type:data.type
    })
    return dispatch => {
      dispatch(
          { 
              type: 'MASTER_REGISTER', 
              data
            }
          )
    }
  }
